import React from "react";
import Todo from "./Todo";
import { MdDelete, MdEdit, MdCheckCircle } from "react-icons/md";
const TodoList = ({ todos, setTodos }) => {
  return (
    <div>
      {todos.map((todo) => {
        return (
          <ul key={todo.id}>
            <li>
              <Todo todo={todo} />

              <div>
                <button>
                  <MdEdit />
                </button>
                <button>
                  <MdCheckCircle />
                </button>
                <button onClick={deleteTodos(todo)}>
                  <MdDelete />
                </button>
              </div>
            </li>
          </ul>
        );
      })}
    </div>
  );
};

export default TodoList;
